import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Belinda',
          id: '12e1231e',
        },
        {
          name: 'Frankie',
          id: '12ed2dacas',
        },
        {
          name: 'Jack',
          id: '1231e',
        },
        {
          name: 'Chase',
          id: '12e1e213',
        },
      ]
    };
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return (
            <div key={monster.id}>
              <h1>{monster.name}</h1>
          </div>
          );
        })}
      </div>
    );
  }}

export default App;
